import {
  Button,
  Popover,
  UncontrolledPopover,
  PopoverBody,
  PopoverHeader,
} from "reactstrap";
import Cart from "./cart";

export default function PopOver() {
  return (
    <div>
      <Popover
        trigger={
          <Button
            type='secondary'
            medium>
            Open Popover
          </Button>
        }>
        <div
          style={{
            color: "var(--geist-background)",
            borderRadius: "var(--geist-radius)",
            width: 200,
            padding: "var(--geist-gap)",
            background: "var(--geist-foreground)",
          }}>
          Tooltip content
        </div>
      </Popover>
    </div>
  );
}
